import React, { Component, useEffect } from 'react'

const API = "http://localhost:5000/questions/showAll"

class Landing extends Component {
  constructor(props) {
    super(props);
    this.state = {
        hits: [],
    };
}


componentDidMount(){
  fetch(API)
  .then(response => response.json())
  .then(data => this.setState({hits:data.hits}))
}
  render() {

    return (
      <ul>
        {hits.map(hit =>
            <li key={hit.id}>{hit.questionTitle}</li>
          )}
      </ul>
    )
  }
}

export default Landing;
